import React,{useEffect, useState} from 'react';
import axios from 'axios';
import DeleteQues from './DeleteQues';

function Delete()
{
    const [questionList, setQuestionList] = useState([]);
    useEffect(() => {
        setQuestion();
      }, []);

    const setQuestion = () => {
        axios.get('http://localhost:8081/getQuesForDelete')
        .then((res)=>{
            console.log(res);
            setQuestionList(res.data);
            console.log(questionList);
        });
      };

    const handleSelection = (event, quesId) => {
        console.log(event);
        setQuestionList(
            questionList.concat(quesId)
        );
      };

    return(
    <div>
        <table>
            <thead>
                <tr>
                    <th></th>
                    <th>Question No.</th>
                    <th>Question Text</th>
                </tr>
            </thead>
            <tbody>
                <tr>
                    <td colSpan = "3">
                    {questionList.map((element, index)=>(
                    <DeleteQues 
                    key = {index} 
                    quesId = {element.id} 
                    quesNo = {element.quesNo} 
                    quesText = {element.quesText} 
                    handleSelection = {handleSelection}
                    />
                    ))}</td>
                </tr>
                <tr>
                    <td colSpan="2">
                        <button className='btn btn-danger w-100'>Delete</button>
                    </td>
                </tr>
            </tbody>
        </table>
    </div>
    );
}

export default Delete;
